import './App.css';
import Category1 from './Category1';
import Category2 from './Category2';
import Category3 from './Category3';
// colors 90A8ED FF90E8 FFC900 23A094 bg-[#E5FAFF]
function App() {
  return (
    <div className = 'grid grid-rows-10 w-screen h-screen bg-[#0A0A0A] body-font font-fleuron'>
      <div className='flex row-span-3 w-full h-full  justify-center content-center '>
        <div className='border-b-2 border-white w-11/12 h-full'></div>
      </div>
      <div className='flex row-span-3 w-full h-full justify-center content-center text-6xl font-fleuron'>
        <div className='w-11/12 border-b-2 border-white mt-10 text-white'>
          Cognitia 2k23 <br/>
          A tech and cultural fest <br/>
          Like no other
        </div>
      </div>
      <div className='flex flex-nowrap overflow-hidden justify-center  w-full h-full '>
        <div className='flex row-span-4 space-x-10 bg-[#0A0A0A]  place-items-center w-11/12 h-full flex-nowrap mt-0'>
          <Category1 
            eventName="Hack the box" 
            eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
            dpt="coding"
          />
          <Category2 />
          <Category3 />
        </div>
      </div>
    </div>
  );
}

export default App;
